import React from 'react';
import { Container, Input, Form, InputGroup, InputGroupAddon, Button, Row } from 'reactstrap';
import '../App.css';


export default function CardSearch(props) {
    return (
        <Container>
            <Row>
                <Form className="inputBox" onChange={props.handleInputChange}>
                    <InputGroup  >
                        <Input />
                        <InputGroupAddon addonType="append"><Button color="secondary">Search</Button></InputGroupAddon>
                    </InputGroup>
                </Form>
            </Row>
        </Container>

    )
}
